description:
This is all 34 issues so far released of Spongebob Comics, as well as all three FCBD issues and the two Swimtacular specials.

All scans are by Jojo except one FCBD each by Team-DCP and Minutemen, and one regular issue collaboration between GreenGiant-DCP and Jojo as well. Thanks to all the scanners for their efforts; please seed and enjoy. 

